export function SortData(data) {
	const records = data.split('\n').map((line) => line.split(','));
	const sortedPlanets = records.slice(1).sort((a, b) => {
		if (a[3] === b[3]) {
			return a[4] - b[4];
		}
		return a[3] - b[3];
	});
  console.log(sortedPlanets);

	const grid = [];
	sortedPlanets.forEach((planet) => {
		if (!grid[planet[3]]) {
			grid[planet[3]] = {};
		}
		if (!grid[planet[3]][planet[4]]) {
			grid[planet[3]][planet[4]] = [];
		}
		grid[planet[3]][planet[4]].push(planet);
	});

	return grid.json;
}
